import React from 'react';
import styled from "styled-components";
import Tags from './tags';

const Wrapper = styled.article`
  margin-top: 50px;
  width: 346px;
  height: 350px;
  border: solid 1px;
`;

const GatherCards = (props) => {
	return (
    <>
    <Wrapper>
      <img src="assets/images/gatherCardThumbnail.png" alt="thumbnail" />
      <div className="container">
        <h3>독서 모임 이름</h3>
        <p>한 줄 소개</p>
        <div className="tags">
          <Tags></Tags>
          <Tags></Tags>
        </div>
        <div className="like">
          <img className="likeButton" src="assets/images/heart.png" alt="icon"/>
          <span>9,999</span>
        </div>
			</div>
    </Wrapper>

    </>
	);
};

export default GatherCards;
